// src/components/AuthenticateFace.js
import React, { useState } from 'react';
import axios from 'axios';

const AuthenticateFace = () => {
  const [file, setFile] = useState(null);
  const [response, setResponse] = useState(null);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleSubmit = async () => {
    const formData = new FormData();
    formData.append('file', file);

    try {
      const result = await axios.post('http://localhost:5001/authenticate_face', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });
      setResponse(result.data);
    } catch (error) {
      setResponse(error.response.data);
    }
  };

  return (
    <div>
      <input type="file" onChange={handleFileChange} />
      <button onClick={handleSubmit}>Authenticate Face</button>
      <pre>{response && JSON.stringify(response, null, 2)}</pre>
    </div>
  );
};

export default AuthenticateFace;
